// Test.js
import React from 'react'
import { Calendar, dateFnsLocalizer } from 'react-big-calendar'
import format from 'date-fns/format'
import parse from 'date-fns/parse'
import startOfWeek from 'date-fns/startOfWeek'
import getDay from 'date-fns/getDay'
import enUS from 'date-fns/locale/en-US'
import 'react-big-calendar/lib/css/react-big-calendar.css'

// Configuration de la localisation
const locales = {
  'en-US': enUS,
}

const localizer = dateFnsLocalizer({
  format,
  parse,
  startOfWeek,
  getDay,
  locales,
})

// Événements de test
const events = [
  {
    title: 'Réunion STB',
    start: new Date(2025, 3, 10, 10, 0), // 10 Avril 2025 à 10h
    end: new Date(2025, 3, 10, 12, 0),
  },
  {
    title: 'Livraison du projet',
    start: new Date(2025, 3, 12, 9, 0),
    end: new Date(2025, 3, 12, 11, 0),
  },
  {
    title: 'Présentation finale',
    start: new Date(2025, 3, 15, 14, 0),
    end: new Date(2025, 3, 15, 15, 30),
  },
]

const Test = () => {
  return (
    <div style={{ height: '600px', padding: '20px' }}>
      <h2>Mon Calendrier</h2>
      <Calendar
        localizer={localizer}
        events={events}
        startAccessor="start"
        endAccessor="end"
        style={{ height: 500 }}
      />
    </div>
  )
}

export default Test
